import React from 'react';
import TextField from '@mui/material/TextField';
import './textbox.css';

const MyTextBox = () => {
  return (
    <TextField
      className='box'
      multiline
      label="Enter Text"
      InputProps={{
        style: {
          color: 'white',
        },
      }}
    />
  );
};

export default MyTextBox;
